"use client"
import { useTheme } from "next-themes"
import { useEffect, useState } from "react"

const ChatIlustration = ({size= 506}:{size?: number}) => {
  const { theme } = useTheme()
  const [rendered, setRendered] = useState(false)

  useEffect(() => {
    setRendered(true)
  },[])
  return rendered && (
    <>
    {theme === "light" && <Light size={size} />}
    {theme === "dark" && <Dark size={size} />}
    </>
  )
}

